import React from 'react'
import { Bar } from "react-chartjs-2"

class TemperatureGraph extends React.Component {
    constructor(props) {
        super(props)
    }
    render () {
        return (
            <div id="TemperatureGraph">
                Bar Chart
                <Bar
                    data={{
                        labels: ["one", "two", "three"]
                    }}
                    height={400}
                    width={600}
                    options={{
                        maintainAspectRatio: false
                    }}
                />
            </div>
        )
    }
}
export default TemperatureGraph
